import ReactDOM from 'react-dom';
import { Axios } from "axios";
import './index.css';

import{
BrowserRouter as Router,
Routes,
Route,
Link,
Redirect
} from "react-router-dom"

import OfertAdd from "./OfertAdd";
import Categories from "./Categories";
import Mainbar from "./Mainbar";
import Hello from "./Hello";
import Register from "./Register";
import Login from "./Login";
import Error from "./Error";
import CategoryOption from "./CategoryOption";
import NameForm from "./NameForm";
import OfertSelect from "./OfertSelect";



function App(){

    // const [movieCategoriesList, setCategoryList] = useState([]);

    // useEffect(()=> {
    //   Axios.get('http://localhost:4000/api/getCategories').then((response)=>
    //   {
    //     setCategoryList(response.data);
    //     console.log({movieCategoriesList});
    //   }
    // )},[])
    return(

      <Router>
        <Routes>
          <Route path='/' element={<div><Mainbar/><Hello login="studencie" /> <OfertSelect /></div>} />
          <Route path={'/Dom'} element={<CategoryOption /> } />
          <Route path={'/Oferts'} element={<OfertSelect /> } />
          <Route path={'/login'} element={<div><Mainbar/><Login /></div> } />
          <Route path={'/register'} element={<div><Mainbar/><Register /></div> } />
          <Route path={'/addOfert'} element={<div><Mainbar/><OfertAdd /></div> } />
          <Route path='*' element={<Error /> } />
        </Routes>
        </Router>);


  }




ReactDOM.render(<App/>,document.getElementById('root'));
